import React from "react";
import ReactDOM from "react-dom";
import SeasonDisplay from "./SeasonDisplay";

const App = () => {
  window.navigator.geolocation.getCurrentPosition()
  return (
    <div>
      <SeasonDisplay />
    </div>
  );
};

if (module.hot) {
  module.hot.accept();
}


ReactDOM.render(<App />, document.getElementById("root"));
